css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("theweek.com") {
/*text&background*/

html, body, tbody, thead, th, tr, td, blockquote, h1, h2, h3, h4, h5, h6, p, form, #footer, div#wrapper, div#header, div#homepage, div#rightHomepage, div.hpModule, div.homepageContent, div#topicArea, div#contentArticle

{
color: white !important;
background: black !important;
}

/*links*/

a

{
color: #0040ff !important;
}

/*highlight*/

textarea, pre

{
background: #333333 !important;
}

}
